var input = (`



`).split('\n');

var keypad = [
    ['X', 'X', 1, 'X', 'X'],
    ['X', 2, 3, 4, 'X'],
    [5, 6, 7, 8, 9],
    ['X', 'A', 'B', 'C', 'X'],
    ['X', 'X', 'D', 'X', 'X'],
];

var code = [];

for (var i = 0; i < input.length; i++) {
    var instructions = input[i];
    var x = 1,
        y = 1;
    for (var j = 0; j < instructions.length; j++) {
        switch(instructions[j]) {
            case 'U':
                y = Math.max(Math.abs(2 - x), y - 1);
                break;
            case 'D':
                y = Math.min(4 - Math.abs(2 - x), y + 1); // 0 => 2, 1 => 3, 2 => 4, 3 => 3, 4 => 2
                break;
            case 'L':
                x = Math.max(Math.abs(2 - y), x - 1);
                break;
            case 'R':
                x = Math.min(4 - Math.abs(2 - y), x + 1);
                break;
        }
    }
    code.push(keypad[y][x]);
}

console.log(`keycode: ${code.join('')}`);